BEGIN;
INSERT INTO `blog_post` VALUES ('1', 'Клиенты для Вашего бизнеса ', 'pervi-post', 'Клиенты для Вашего бизнеса ', 'Основная задача коммерческого сайта состоит в том что бы сайт продавал. Сайт должен по максимум привлекать клиентов в Ваш бизнес. При разработке сайта наша комп', 'увеличение продаж, создание сайта томск', '2013-12-07 07:15:15', '<p>Следуя за тенденцией современного дизайна, мы внедряем в проекты наших&nbsp;клиентов инструменты, которые способствуют увеличению продаж и привлечению&nbsp;постоянных клиентов.</p>\r\n', 'blog/489526-1920x1080.jpg', 'notmain', 'blue', 'icons/lightbulb32.png'), ('2', 'Увеличение дохода ', 'second-main', 'Увеличение дохода ', 'Увеличение дохода — как снижение расходов.  Сайт это не заменимый инструмент для развития бизнеса, многие инструменты внедренные в Ваш сайт будут способствовать', 'создание сайта,  автоматизация бизнеса ', '2013-12-21 11:01:25', '<p>Снижение расходов - это увеличение доходов. Специальные инструменты способствуют&nbsp;снижению расходов с помощью замены ручного труда на автоматические процессы.</p>\r\n', 'blog/409662-3360x2100.jpg', 'notmain', 'blue', 'icons/notecheck32.png'), ('3', 'Выход на новые рынки сбыта ', 'third', 'Выход на новые рынки сбыта', 'Сайт позволяет безгранично расширить границы Вашего бизнеса.  Интернет позволяет привлечь на Ваш сайт людей с разных городов и стран.  Современные технологии по', 'создание сайта,  создание мультиязычного сайта, ', '2013-12-21 11:03:07', '<p>Сайт позволяет&nbsp;расширить границы Вашего бизнеса. Интернет позволяет привлечь на Ваш сайт людей с разных городов и стран. Сайт это&nbsp;высокая конкурентоспособность.</p>\r\n', 'blog/436934-1920x1200.jpg', 'notmain', 'blue', 'icons/phone32.png');
COMMIT;

