-- ----------------------------
--  Table structure for `flatblocks_flatblock`
-- ----------------------------
DROP TABLE IF EXISTS `flatblocks_flatblock`;
CREATE TABLE `flatblocks_flatblock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `slug` varchar(255) NOT NULL,
  `header` varchar(255) DEFAULT NULL,
  `content` longtext,
  PRIMARY KEY (`id`),
  UNIQUE KEY `slug` (`slug`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Records of `flatblocks_flatblock`
-- ----------------------------
BEGIN;
INSERT INTO `flatblocks_flatblock` VALUES ('1', 'main_seo_1', '', '<p>Поисковая оптимизация и продвижение сайта (SEO &ndash; это комплексная услуга по увеличению посещаемости сайта целевыми клиентами из поисковых систем. Этот инструмент привлечения покупателей по эффективности  превосходит такие методы рекламы, как печатная, телевизионная или реклама на радио, так как обеспечивает максимально точное попадание в целевую аудиторию и имеет наименьшую стоимость контакта с потенциальным клиентом.</p>\r\n\r\n'), ('2', 'main_seo_2', '', 'Одним из важнейшим фактором эффективного продвижения сайта, увеличение продаж и клиентов, является грамотный анализ поведения посетителей на сайте. Для этого существует ряд полезных сервисов. Данные инструменты  предназначены для оценки посещаемости сайта, анализа поведения посетителей и эффективности рекламных кампаний. Возможность узнать от куда к Вам на сайт пришел посетитель, пришел он с поисковой системе или с другого источника.'), ('3', 'main_seo_3', '', 'Вы решили продвигать свои товары или услуги через сайт, нужно подготовить сайт к потоку посетителей. Для этого поможет аудит (анализ) сайта.\r\nАудит сайта нужно проводить для разных направлений. Прежде всего, нужно провести маркетинговый аудит сайта, чтобы всесторонне проанализировать продукт клиента и его окружение в Интернете. Поисковый аудит сайта покажет какие страницы проиндексировались поисковиками. Далее нужно провести аудит юзабилити сайта, который позволит увеличить конверсию посетителей в покупателей.'), ('4', 'main_seo_4', '', 'Контекстная реклама показывается Вашим потенциальным клиентам. Они обязательно увидят ее, потому что разместить контекстную рекламу можно на выгодных позициях. С помощью контекстной рекламы в интернете Вы получите клиентов сразу как только начнет работать Ваш сайт.\r\nОна позволяет размещать информацию о товарах или услугах в поисковых системах и на тысячах сайтов. Причем реклама видна только тем пользователям, которые уже искали информацию о подобной продукции. '), ('5', 'top_text', '', 'Создайте сайт который будет работать семь дней в неделю и принесет Вам прибыль.');
COMMIT;

